66. You are testing a Category A airborne software and just finished specifications based 
tests. An analysis of the coverage level reached indicates that 20% of the code has 
not been executed by the test cases you designed. Based on this coverage 
information, what decision should you take? 
A. You decide to add tests to reach 100% instructions coverage.
B. You decide to add tests to reach 100% decisions coverage. 
C. You decide to add tests to reach 100% conditions coverage. 
D. You decide to add tests to reach 100% modified conditions and decisions 
coverage. 
Select ONE option. 
67. Consider the following function: 
int factorial(int n) 
/* factorial computation with recursivity* 
 * the function calls itself * 
 * Mathematical description * 
* n! = n*((n-1)!) * 
 * Factorial of 0 and 1 equals 1. */ 
{ 
int f=-1; 
 if (n < 0) { 
fprintf(stderr, "factorial: negative argument.\n"); 
} else if ((n == 0) || (n == 1)) { 
 f=1; 
 } else { 
 f=n*factorial(--n); 
 } 
 return(f); 
} 
Assume you have a test environment that allows you to provide values to the 
"factorial" function (the inputs) and check the returned values (the outputs). Which 
sequence of tests will give you 100% decisions coverage with the smallest number of 
tests? Consider that the input is the first value and the output the second value. 
A. 0, 1; 1, 1; 2, 2. 
B. – 1, – 1; 1, 1; 5, 120. 
C. – 1, – 1; 0, 1; 1, 1; 3, 6. 
D. – 1, – 1; 0, 1; 4, 12. 
Select ONE option.
